import React, { Component } from 'react';

const navStyle = {
    display: 'flex',
    justifyContent: 'space-around',
    alignItems: 'center',
    minHeight: '10vh',
    backgroundColor: '#FFFFFFF',
    color: '#FFFFFFF'
  }


class Nav extends Component {

    render() { 

        const linkDecoreation = {
            color: "#FFFFFF"
        }

        return(
            <nav style={navStyle}>
                <h3>Logo</h3>
                <ul className="nav-links">
                    <li>About</li>
                </ul>
            </nav>
        );
    }
}

export default Nav;
